import Contact from './Contact'
import img1 from '../img/Harry.jpg';
import img2 from '../img/Heisenberg.jpg';
import img3 from '../img/Pinkman.jpg';
import img4 from '../img/Katniss.jpg';

export default function ContactList(props){

return (
    <Table striped bordered hover variant="dark">
    <thead>
        <tr>
        <th></th>
        <th>First Name</th>
        <th>Last Name</th>
        <th>Email</th>
        <th>Phone</th>
        </tr>
    </thead>
    <tbody>
        <Contact img={img1} name = "Harry" surname = "Potter" email="harrypotter@hogwarts.com" phone="614-123-24-25" ></Contact>
        <Contact img={img2} name = "Walter" surname = "White" email="heisenberg@bb.com" phone="614-123-45-67" ></Contact>
        <Contact img={img3} name = "Jesse" surname = "Pinkman" email="pinkman@bb.com" phone="614-123-32-21" ></Contact>
        <Contact img={img4} name = "Katniss" surname = "Everdeen" email="mockingjay@hg.com" phone="614-123-23-23" ></Contact>
    </tbody>
    </Table> 
) }
